webpackJsonp([253],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-the-agile-manifesto.json":function(e,i){e.exports={data:{markdownRemark:{html:'<h3>For Agile Software Development</h3>\n<p>Agile development was written in 2001 by a group of 17 software experts that included the creators of Scrum Extreme Programming (XP), Dynamic Systems Development Method (DSDM), and Crystal; a representative of feature-driven development; and several other thought leaders in the software industry. The Agile Manifesto established a common set of overarching values and principles for all of the individual agile methodologies at the time. This is that manifesto.</p>\n<p>We are uncovering better ways of developing software by doing it and helping others do it.Through this work we have come to value:</p>\n<ol>\n<li>Individuals and interactions over processes and tools.</li>\n<li>Working software over comprehensive documentation</li>\n<li>Customer collaboration over contract negotiation</li>\n<li>Responding to change over following a plan</li>\n</ol>\n<blockquote>\n<p>That is, while there is value in the items on the right, we value the items on the left more.</p>\n</blockquote>\n<p>Original Signators:</p>\n<ul>\n<li>Kent Beck</li>\n<li>Mike Beedle</li>\n<li>Arie van Bennekum</li>\n<li>Alistair Cockburn</li>\n<li>Ward Cunningham</li>\n<li>Martin Fowler</li>\n<li>James Grenning</li>\n<li>Jim Highsmith</li>\n<li>Andrew Hunt</li>\n<li>Ron Jeffries</li>\n<li>Jon Kern</li>\n<li>Brian Marick</li>\n<li>Robert C. Martin</li>\n<li>Steve Mellor</li>\n<li>Ken Schwaber</li>\n<li>Jeff Sutherland</li>\n<li>Dave Thomas</li>\n</ul>\n<p>Read the original at <a href="http://agilemanifesto.org/">http://agilemanifesto.org/</a></p>',frontmatter:{title:"The Agile Manifesto",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/the-agile-manifesto/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/the-agile-manifesto/"}}}});
